H House::init(int object_id, double longitude, int angle) {
    SplitDeg splig_deg = Swe17::split_deg(longitude, 0);
    H h;
    h.object_id = object_id;
    h.longitude = longitude;
    h.split = splig_deg;
    h.angle = angle;
    return h;
}